    render() {
        function getPeople(){
            fetch('http://localhost:3001/data')
            .then(res => res.json())
            .then(data => {
              console.log(data);
            })
          }
        return (
            <div>
                <h2>Data</h2>
                <tbody>
                <tr>
                  <th>Name</th>
                  <th>Last Name</th>
                  <th>Age</th>
                  <th>Occupation</th>
                </tr>
                
                  <tr>
                    <td>Name</td>
                    <td>Lastt</td>
                    <td>Age</td>
                    <td>Occupa</td>
                  </tr>
          </tbody>
            </div>
        )
    }
}
